$(function(){$(".del").click(function(t){$(t.target);var e=$(this).attr("date-id");console.log(e);var i=$(".item-id-"+e);$.ajax({type:"DELETE",url:"/admin/list?id="+e}).done(function(t){1===t.success&&i.length>0&&i.remove()})}),$(".del_user").click(function(t){$(t.target);var e=$(this).attr("date-id");console.log(e);var i=$(".item-id-"+e);$.ajax({type:"DELETE",url:"/admin/userlist?id="+e}).done(function(t){1===t.success&&i.length>0&&i.remove()})})});